    //                 let l = [];
    //                 for (var i = 0; i < fetchedDocuments.length; i++) {
    //                   let su = [];
    //                   for (
    //                     var j = 0;
    //                     j < fetchedDocuments[i].sharedUsers.length;
    //                     j++
    //                   ) {
    //                     let obj = { ...fetchedDocuments[i].sharedUsers[j] };
    //                     su.push({
    //                       userId: obj.userId,
    //                       permissions: obj.permission.split(","),
